{-# LANGUAGE RankNTypes #-}
module Bench.Core (coreTests) where

import Criterion
import Control.DeepSeq
import Data.Ratio ((%))
import Math.Polynomial
import Data.List (foldl')

coreTests :: [Benchmark]
coreTests = evalData `seq`
    [ bgroup "addPoly"      (binOpTests    1000 addPoly)
    , bgroup "multPoly"     (binOpTests    1000 multPoly)
    , bgroup "composePoly"  (binOpTests    100  composePoly)
    , bgroup "quotPoly"     (binOpTestsF   1000 quotPoly)
    , bgroup "remPoly"      (binOpTestsF   1000 remPoly)
    , bgroup "gcdPoly"      (binOpTestsF   1000 gcdPoly)
    , bgroup "negatePoly"   (unaryOpTests  1000 negatePoly)
    , bgroup "polyDeriv"    (unaryOpTests  1000 polyDeriv)
    , bgroup "polyIntegral" (unaryOpTestsF 1000 polyIntegral)
    ]

unaryOpTests :: Int -> (forall a. (Num a, NFData a) => Poly a -> Poly a) -> [Benchmark]
unaryOpTests nCases op = 
    [ bench "Int"      (unaryOp nCases op intPolys)
    , bench "Float"    (unaryOp nCases op floatPolys)
    , bench "Double"   (unaryOp nCases op doublePolys)
    , bench "Integer"  (unaryOp nCases op integerPolys)
    , bench "Rational" (unaryOp nCases op rationalPolys)
    ]

unaryOpTestsF :: Int -> (forall a. (Fractional a, NFData a) => Poly a -> Poly a) -> [Benchmark]
unaryOpTestsF nCases op = 
    [ bench "Float"    (unaryOp nCases op floatPolys)
    , bench "Double"   (unaryOp nCases op doublePolys)
    , bench "Rational" (unaryOp nCases op rationalPolys)
    ]

unaryOp nCases op xs = mapM_ nfIO $ take nCases $ map (return . op) xs

binOpTests :: Int -> (forall a. (Num a, NFData a) => Poly a -> Poly a -> Poly a) -> [Benchmark]
binOpTests nCases op = 
    [ bench "Int"      (binOp nCases op intPolys      intPolys)
    , bench "Float"    (binOp nCases op floatPolys    floatPolys)
    , bench "Double"   (binOp nCases op doublePolys   doublePolys)
    , bench "Integer"  (binOp nCases op integerPolys  integerPolys)
    , bench "Rational" (binOp nCases op rationalPolys rationalPolys)
    ]

binOpTestsF :: Int -> (forall a. (Fractional a, NFData a) => Poly a -> Poly a -> Poly a) -> [Benchmark]
binOpTestsF nCases op = 
    [ bench "Float"    (binOp nCases op floatPolys    floatPolys)
    , bench "Double"   (binOp nCases op doublePolys   doublePolys)
    , bench "Rational" (binOp nCases op rationalPolys rationalPolys)
    ]

binOp nCases op lhss rhss = mapM_ nfIO $ take nCases
    [ return (op lhs rhs)
    | lhs <- lhss
    , rhs <- rhss
    ]


